    <div>
        <h1>{nameOfTheBook}</h1>
        <h3>By {nameOfTheAuthor}</h3>
        <h4>Rating = {Rating}</h4>
        <h4>Price = ${pr}</h4>
    </div>
  )


}

export default Book
